    real_name: 'Nam Hoang Hau Han Tu Cao (2016) (2016)',
    content: 'Câu chuyện về vị nam ‘Hoàng hậu’ duy nhất trong lịch sử Trung Hoa Hàn Tử Cao là một mỹ nam nổi tiếng nhà Trần đời Nam Bắc Triều (538-567). Vẻ đẹp của chàng được miêu tả trong sử sách xưa như sau: diện mạo đẹp đẽ, tươi sáng như ngọc, tóc mượt đen dài, mắt đẹp như tằm, hình dáng tuấn tú, cao dong dỏng, đôi tay dài cuốn hút khiến cả nam giới lẫn nữ giới đều say mê. Sinh ra trong thời loạn, bản thân Hàn Tử Cao không biết bao nhiêu lần đối mặt với cái chết khi dao kề cổ nhưng lạ thay, bọn loạn quân khi nhìn thấy gương mặt quá tuấn tú của chàng mà không thể ra tay được, ngược lại còn giúp chàng thoát khỏi chốn hiểm nguy. Hàn Tử Cao cùng cha mở một tiệm giày ở kinh đô, khách hàng chủ yếu là nữ, họ ra vào nườm nượp không phải để mua giày mà là để có cơ hội được ngắm nhìn Tử Cao. Công chúa triều Trần tài sắc vẹn toàn mới nhìn thấy chàng 1 lần đã đem lòng si mê, công chúa bỏ mặc vị hôn phu của mình để ngày nào cũng mang vàng bạc châu báu đến mong chàng động lòng nhưng kỳ lạ thay, Tử Cao lại chẳng mảy may rung động. Không được đáp lại, một thời gian sau, công chúa tương tư mà qua đời. Một hôm, Hàn Tử Cao cùng cha đến thái thú phủ xin giấy thông hành. Quan thái thú lúc bấy giờ là Trần Tây, một vị tướng trẻ tuổi, oai phong và lẫm liệt, nhìn thấy vẻ đẹp của Hàn Tử Cao bỗng thấy động lòng, bèn bước đến và hỏi: “Người đẹp, ngươi có muốn theo ta không?”. Đứng trước vị tướng quân ấy, Hàn Tử Cao dường như không mảy may suy nghĩ mà gật đầu đồng ý! Điều kỳ lạ là Trần Tây cũng có nhiều vợ nhưng chưa bao giờ ngủ qua đêm ở phòng người vợ nào nhưng từ khi có Tử Cao, hai người quấn quýt như hình với bóng. Hằng ngày, Trần Tây dạy Hàn Tử Cao cưỡi ngựa, bắn cung, chẳng bao lâu Tử Cao đã có thể cùng Trần Tây xông pha trận mạc. Trần Tây yêu Tử Cao đến mức hẹn với chàng là nếu có một ngày Trần Tây trở thành Hoàng đế sẽ nhất định phong cho Hàn Tử Cao làm Hoàng hậu. Sau khi dẹp loạn, tạm trấn yên bờ cõi, Trần Tây lên ngôi Hoàng đế, gọi là Trần Văn Đế. Đúng như lời ước hẹn, ông muốn lập Hàn Tử Cao làm Hoàng hậu nhưng do ngai vàng chưa vững và quần thần phản đối quyết liệt. Từ xưa đến nay, chưa hề có tiền lệ lập một người đàn ông lên làm mẫu nghi thiên hạ. Đất nước chưa hết hẳn loạn lạc và cũng để tranh thủ thêm sự ủng hộ của quần thần nên Trần Tây đành tạm gác lại việc sắc phong cho Tử Cao. Dù không phải là người danh chính ngôn thuận nhưng trong lòng Trần Văn Đế, Tử Cao luôn là Hoàng hậu duy nhất. Một thời gian sau, khi Trần Văn Đế lâm bệnh nặng, Hàn Tử Cao luôn là người cận kề thuốc thang, chăm sóc. Chuyện tình đồng giới giữa Hàn Tử Cao và Trần Văn Đế được sử sách ghi lại rất chi tiết và bị người đời chê cười, nhưng tình cảm đồng giới vào sinh ra tử có nhau của họ cũng khiến rất nhiều người ngưỡng mộ. Đây quả là mối tình xưa nay hiếm, có một không hai trong lịch sử thời bấy giờ.',
